import { createIcon } from "../icon/createIcon";

export const AddIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="AddIcon">
    <path d="M7 1v4h4v2H7v4H5V6.999L1 7V5l4-.001V1h2z" />
  </svg>,
  "Add",
  "add"
);
